// src/pages/Landing/Landing.jsx
import React from "react";
import { Link } from "react-router-dom";
import Button from "../../components/Button";

const Landing = () => {
  return (
    <div className="flex flex-col items-center justify-center min-h-screen bg-orange-50 p-6">
      {/* Hero Section */}
      <div className="text-center max-w-2xl">
        <h1 className="text-4xl md:text-5xl font-bold text-orange-500 mb-4">
          Welcome to RoomieRadar
        </h1>
        <p className="text-gray-700 mb-6 text-lg">
          Find your perfect roommate match! Answer lifestyle questions and get compatibility scores, conflict forecasts, and tips to improve your shared living experience.
        </p>

        <div className="flex flex-col sm:flex-row justify-center gap-4">
          {/* Start Questionnaire */}
          <Link to="/questionnaire">
            <Button text="Start Questionnaire" type="primary" />
          </Link>

          {/* View Dashboard */}
          <Link to="/dashboard">
            <Button text="View Dashboard" type="secondary" />
          </Link>
        </div>
      </div>

      {/* Optional illustration/image */}
      <div className="mt-12">
        <img
          src="/assets/images/roomie-illustration.png"
          alt="Roomie Illustration"
          className="w-80 h-auto mx-auto"
        />
      </div>
    </div>
  );
};

export default Landing;
